import * as React from "react";
import { ButtonGroup } from "@mui/material";
import { Checkbox } from "@mui/material";
import { TextField } from "@mui/material";
import './Stylesheets/LoginForm.css';
import { Stack, Paper, Grid, Button } from "@mui/material";

function LoginForm(){
    return <Stack spacing={6} direction="column" justifyContent="center" alignItems="stretch"><TextField item sx={{mr:5, ml:5}} variant="standard" size="small"></TextField>
                              <TextField margin="normal" xs={50} variant="standard" size="small"></TextField></Stack>;
}

export default LoginForm;
